import{
  BrowseRouter,
  Routes,
  Route,
} from "react-router-dom"

import Login from "./components/Login";
import Home from "./components/Home";

function App() {
  return (
   <>
   <BrowseRouter>
   <Routes>
    <Route path="/" element={<Login/>} />
    <Route path="/" element={<Home/>} />


   </Routes>
   </BrowseRouter>
   </>
  );
}


export default App;
